import React from "react";
import { NavLink } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <NavLink to="/">Home</NavLink>
      <NavLink to="/contact">About</NavLink>
      <NavLink to="/contact">Contact</NavLink>
      <br />
    </>
  );
};
export default Menu;
